import React from 'react'
import './landingpage.css'

const Infomercial = () => {
    return(
        <div className='infomercial'>
            
            <iframe className='infovideo' width="420" height="420"
                src="https://www.youtube.com/embed/-AiULl6dU4Q">
            </iframe>
            
        </div>
    )
}

export default Infomercial
